import "./Contact.scss";
import PaperPlane from "../../../assets/images/paper-plane.jpg";

const Contact = () => {


    return (
        <main className="contact">
            <h1>Contact</h1>
            <p>If you have media queries about my books or want to discuss illustrations for your own books or merchandise,
                please contact me using hello@readchastain.com
                If you want to follow me on social media, I am available on Facebook and Instagram.</p>
            <section className="contact__hero">
                <img className="contact__hero__image" src={PaperPlane} alt="people throwing paper plane" />
            </section>
        </main>
    );
};

export default Contact;
